import React from "react";

import {Home} from './pages'

import {Header} from './components';
import { Route, Router, Routes } from "react-router";



function App() {

  return (
    <Router>
      <div className="wrapper">
      <Header />
      <div className="content">   


      <Routes>
        <Route path="/pages/Home" element={<Home/>}/> 

      </Routes>
    </div>
  </div>
  </Router>
  );
}


export default App;
